import React, {Component} from "react";

export default class RecordList extends Component {
    constructor(props) {
        super(props);
        this.state = {
            isChecked: true,
          };
    }


    toggleChange = () => {
        this.setState({
          isChecked: !this.state.isChecked,
        });
        if(this.state.isChecked === true) {
            console.log('AAAAA')
        }
      }
       
    render() {

        return(
            
            <div>

            <input type="checkbox" id="checkbox" defaultChecked={this.state.isChecked}
          onChange={this.toggleChange}/>
            
            <td className = 'a'>{this.props.obj.d_sku}</td>

            <td className = 'a'>{this.props.obj.d_name}</td>
  
            <td className = 'a'>{this.props.obj.d_price + "$"}</td>
  
            <td className = 'a'>{this.props.obj.d_attribute}</td>

            </div>
        )
    }
}
